import Projects from './ProjectClass';
import { useState } from 'react';
import { Link } from 'react-router-dom';

export function ProjectsPage() {
    const [projectList, changeProjectList] = useState(new Projects());

    return(
        <div className="ProjectsPage">
            <h1>Projects</h1>
        
            <ProjectList projectList={projectList.projects}/>
        </div>
    );
}

function ProjectList(props) {
    var projectListItems = props.projectList ?
        props.projectList.map((project, id) => {
            return(
                <li key={id}>
                    <ProjectListItem name={project.name} id={id}/>
                </li>
            );
        }) :
        [];

    return(
        <ul className="ProjectList">
            {projectListItems}
            <li>
                <CreateProject />
            </li>
        </ul>
    );
}

function ProjectListItem(props) {


    return(
        <div className="ProjectListItem">
            <Link to={"/project-" + props.id}>
                <button>
                    {props.name}
                </button>
            </Link>
        </div>
    );
}

function CreateProject(props) {
    const [createProject, changeCreateProject] = useState(false);

    return(
        <div className="CreateProject">
            {
                createProject ?
                <button onClick={() => changeCreateProject(false)}>Create On</button> :
                <button onClick={() => changeCreateProject(true)}>Create Off</button>
            }
        </div>
    );
}
